import Header from "./Header";
import Footer from "./Footer";
import CreateNote from "./CreateNote";
import Note from "./Note";
import "./Keep.css";

const Keep = () => {

return(
    <>
       <Header/>
       <CreateNote/>
       <Note/>
       <Footer/>
    </>
);
};
export default Keep;
